webpackJsonp([0xb686b0ddd112],{3969:function(n,p){n.exports={data:{markdownRemark:{html:"<h2>-1-</h2>\n<p>「この長く黒い棒を辿って行けば幽々子様に会えるわ」<br>\n「どうして分かるんだ？」<br>\n「今日は節分でこの棒は南南東を向いているからよ」</p>\n<h2>-2-</h2>\n<p>「あー霊夢、なんでお前こんな神社の外で拗ねてるんだ？」　\n「…くすん、宴会のショバ代で一人辺り 100 万円催促しただけなのに」　\n「あぁなるほどな、炒り豆は痛かったろ」</p>\n<h2>-3-</h2>\n<p>「紫様、良い知らせと悪い知らせがあります」<br>\n「なにかしら？良い知らせから聞かせなさい」<br>\n「はい、紫様がこの宴会メンバーの中で一番多く豆を食べる権利を獲得しました」</p>\n<h2>-4-</h2>\n<p>「幽々子様！それは恵方巻ではありません！楼観剣です！」</p>\n<h2>-5-</h2>\n<p>「幽々子様！それは恵方巻ではありません！西行妖です！」</p>\n<h2>-6-</h2>\n<p>「萃香、お前には節分は災難だな。豆撒かれて家から追い出されて」<br>\n「もう慣れたって。また新しいダンボール探してくればいいだけの話だし」</p>\n<h2>-7-</h2>\n<p>「おっにわーそと！ふっくわーうち！」<br>\n「ｺﾞﾙｧーーーーーーーーーーー！！」<br>\n「のわー！ホントに鬼が出た！！」<br>\n「食べ物を粗末にするなー！」</p>\n<h2>-8-</h2>\n<p>「ねぇ萃香、節分の後の庭片付けてくれるのは助かるんだけど、何も褒美とかないわよ？」<br>\n「大丈夫大丈夫、これで今日明日の飯に困らないんだから安いもんよ」</p>\n<h2>-9-</h2>\n<p>「紫様、もう無理なさらないでください！こんな幻想郷の三分の一を埋め尽くすほどの量の豆なんて食べられるわけないじゃないですか！」</p>\n<h2>-10-</h2>\n<p>「こらー！豆撒きに混じって弾幕撃つなー！！舌を火傷しちゃったじゃないかー！」</p>",frontmatter:{cover:null,date:"2006-02-03T10:39:00+09:00",strDate:"2006/2/3",title:"本文"}}},pathContext:{path:"/ja/blog/2006/02/03-touhou-novel-setsubun/",langKey:"ja"}}}});
